import React, { useRef } from 'react';
import './App.css';
import ViewCard from './components/ViewCard';

function App() {
  const appRef = useRef<HTMLDivElement>(null);
  if (appRef.current) 
  return (
    <div ref={appRef}>
      <ViewCard />
    </div>
  );
}

export default App;
